Peter Pan neemt je opnieuw mee op een magische reis achter 'de tweede ster rechts&quot; naar de plaats waar je nooit oud wordt: &quot;Nooitgedachtland&quot;. Al je favoriete figuren zijn terug en je zal ook kennis maken met de 12-jarige Jane, de dochter van Wendy, die te groot is voor de verhalen uit haar moeders jeugd over vliegen met Peter Pan. Jane gelooft niet meer in sprookjes maar als het piratenschip van Kapitein Haak in Londen terechtkomt en Jane ontvoert naar Nooitgedachtland, ontdekt ook zij dat hij nog altijd niets liever wil dan wraak nemen op Peter Pan. De slimme piraat bedenkt een plan om Peter Pan en Tinkelbel in de val te lokken, en Jane is de enige die dat kan voorkomen. PETER PAN: TERUG NAAR NOOITGEDACHTLAND staat van het begin tot het einde garant voor geweldige animatie, compleet nieuwe muziek en gevleugeld avontuur.

